CREATE schema dvd;

CREATE TABLE dvd.products (
    prod_id integer NOT NULL,
    category smallint NOT NULL,
    title text NOT NULL,
    actor text NOT NULL,
    price numeric NOT NULL,
    special smallint,
    common_prod_id integer,
    key pgdms_did DEFAULT NULL::uuid NOT NULL
);

CREATE TABLE dvd.categories (
    category integer NOT NULL,
    categoryname character varying(50) NOT NULL
);

CREATE TABLE dvd.customers (
    customerid integer NOT NULL,
    firstname character varying(50) NOT NULL,
    lastname character varying(50) NOT NULL,
    address1 character varying(50) NOT NULL,
    address2 character varying(50),
    city character varying(50) NOT NULL,
    state character varying(50),
    zip character varying(9),
    country character varying(50) NOT NULL,
    region smallint NOT NULL,
    email character varying(50),
    phone character varying(50),
    creditcardtype integer NOT NULL,
    creditcard character varying(50) NOT NULL,
    creditcardexpiration character varying(50) NOT NULL,
    username character varying(50) NOT NULL,
    password character varying(50) NOT NULL,
    age smallint,
    income integer,
    gender character varying(1)
);

CREATE TABLE dvd.inventory (
    prod_id integer NOT NULL,
    quan_in_stock integer NOT NULL,
    sales integer NOT NULL,
    prod_key pgdms_family_ref
);

CREATE TABLE dvd.orderlines (
    orderlineid smallint NOT NULL,
    orderid integer NOT NULL,
    prod_id integer NOT NULL,
    quantity smallint NOT NULL,
    orderdate date NOT NULL,
    orderlinekey integer NOT NULL,
    prod_key pgdms_ref
);

CREATE TABLE dvd.orders (
    orderid integer NOT NULL,
    orderdate date NOT NULL,
    customerid integer,
    netamount numeric NOT NULL,
    tax numeric NOT NULL,
    totalamount numeric NOT NULL,
    comment text
);
















ALTER TABLE ONLY dvd.categories
    ADD CONSTRAINT categories_pkey PRIMARY KEY (category);


ALTER TABLE ONLY dvd.customers
    ADD CONSTRAINT customers_pkey PRIMARY KEY (customerid);


ALTER TABLE ONLY dvd.inventory
    ADD CONSTRAINT inventory_pkey PRIMARY KEY (prod_id);


ALTER TABLE ONLY dvd.orderlines
    ADD CONSTRAINT orderlines_pkey PRIMARY KEY (orderlinekey);

ALTER TABLE ONLY dvd.orders
    ADD CONSTRAINT orders_pkey PRIMARY KEY (orderid);

ALTER TABLE ONLY dvd.products
    ADD CONSTRAINT products_pkey PRIMARY KEY (key);


ALTER TABLE ONLY dvd.orders
    ADD CONSTRAINT fk_customerid FOREIGN KEY (customerid) REFERENCES dvd.customers(customerid) ON DELETE SET NULL;


ALTER TABLE ONLY dvd.orderlines
    ADD CONSTRAINT fk_orderid FOREIGN KEY (orderid) REFERENCES dvd.orders(orderid) ON DELETE CASCADE;


ALTER TABLE ONLY dvd.orderlines
    ADD CONSTRAINT fk_prod_key FOREIGN KEY (prod_key) REFERENCES dvd.products(key);



ALTER TABLE ONLY dvd.inventory
    ADD CONSTRAINT inventory_prod_key_fkey FOREIGN KEY (prod_key) REFERENCES dvd.products(key);


ALTER TABLE ONLY dvd.products
    ADD CONSTRAINT products_category_fkey FOREIGN KEY (category) REFERENCES dvd.categories(category);

	
	
	


















	

